import NavBar from './NavBar.js'
import Link from './Link.js'
import './App.css';
import './fonts.css';

function App() {
  return (
  <NavBar>
  <Link name='Sign UP' func={(event)=>{
    event.preventDefault()
    console.log('sign in')
  }}/>

  <Link name='Login' func={(event)=>{
    event.preventDefault()
    console.log('Login')
  }}/>
  </NavBar>
  );
}

export default App;
